import "./Footer.css";
const FooterPage = () => {
  return (
    <footer className="text-center text-white mt-5 footer">
      {/* <br></br> */}
      <div>
        <Row>
          <Col>
            <h5>AAAAAAAAAAAAA</h5>
          </Col>

          <Col>
            <h5>AAAAAAAAAAAAA</h5>
          </Col>
        </Row>
      </div>
      <i>Made by @AbhayChauhan</i>
      <br></br>
    </footer>
  );
};

export default FooterPage;
